// int32_t sine2t[SINE2TSIZE + 1];
uint32_t pitcht[PITCHTSIZE];

void bingBongMathInit() {
    // // Sine wave too big to fit in RAM, pre-calculated array below
    // int32_t *p32 = (int32_t *)sine2t;
    // for (int i = 0; i < SINE2TSIZE + 1; i++) {
    //     float f = i * 2 * PI_F / (float)SINE2TSIZE;
    //     *p32++ = (int32_t)(INT32_MAX * sinf(f));
    // }

    uint32_t *q;
    q = (uint32_t *)pitcht;
    for (int i = 0; i < PITCHTSIZE; i++) {
        double f = 440.0 * powf(2.0, (i - 69.0 - 64.0) / 12.0);
        double phi = 4.0 * (double)(1 << 30) * f / (SAMPLE_RATE * 1.0);
        if (phi > ((unsigned int)1 << 31))
            phi = 0x7FFFFFFF;
        *q++ = (uint32_t)phi;
    }
}

